import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="App">
      <div class="container">
        <div class="navbar-left">
          <ul>
            <li>
              <button class="habit-rabbit top-right">Habbit Rabbit</button>
            </li>
          </ul>
        </div>
        <div class="navbar-right">
          <a class="nav-button right-align p-sm-2">Home</a>
          <a class="home-button right-align p-sm-2">About</a>
          <a class="home-button right p-sm-2">Sign In</a>
        </div>
      </div>  
    </div>
  );
}

export default App;
